Равенство, обеспечивающее получение непрерывного синхронизированного процесса, выражается формулой:
А -     t1 · С1= t2 · С2 = ... = ti · Сi = ... = tm · Сm = const;
Б -    t1 /С1= t2 /С2 = ... = ti /Сi = ... = tm /Сm = const;
В -    t1 / r= t2  / r = ... = ti / r = ... = tm / r = const;
Г -     r /С1= r /С2 = ... = r /Сi = ... = r /Сm = const;
где ti — штучное время обработки детали на i-й операции (i = 1,…, т); С— число рабочих мест на i-й операции; r — такт потока.

